			 let shader_module19 = device.create_shader_module(ShaderModuleDescriptor { label: Some("radial_wave"), source: ShaderSource::Glsl { shader: Cow::from("#version 450\r\n\r\nlayout(location = 0) in vec2 position;\r\nlayout(location = 0) out vec2 postiion_cs;\r\n\r\nlayout(set = 0, binding = 0) uniform Param {\r\n    mat4 vertexMatrix;\r\n    vec4 diffuseMat;\r\n\r\n    float centerx;\r\n    float centery;\r\n    float aspect_ratio;\r\n    float start;\r\n\r\n    float end;\r\n    float cycle;\r\n    float weight;\r\n    float depth;\r\n\r\n    float alpha;\r\n    float src_preimultiplied;\r\n    float dst_preimultiply;\r\n    // float wasm0;\r\n    // float wasm1;\r\n    float wasm2;\r\n};\r\n\r\nvoid main() {\r\n    vec4 positionUpdate = vec4(position * 2.0, 1.0, 1.0);\r\n\r\n    gl_Position = vertexMatrix * positionUpdate;\r\n    gl_Position.z = depth;\r\n    gl_Position.w = 1.0;\r\n\r\n    postiion_cs = position + 0.5;\r\n    postiion_cs.y = 1.0 - postiion_cs.y;\r\n}"), stage: ShaderStage::Vertex, defines: HashMap::default() } });
